import React from 'react';

import styles from './TrackLine.module.scss';

function TrackLine({ name }) {

   return (
      <div className = { styles.trackLine } >
         <div className = { styles.background }></div>
         {/* <span>Start</span> */}
      </div>
   )
}

export default TrackLine;
